        <div className="dialog-content"> <span>Total Number of grades:  &nbsp; &nbsp;</span> {this.props.myCourier[2]}</div>{' '}
        </div>{' '}
        <div className="dialog-footer">
          <button className="btn" onClick={this.props.closeCourier}>
            {' '}
            Close{' '}
          </button>{' '}
        </div>{' '}
      </div>
  )
}
}

